import React, { lazy, Suspense, useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import TermsAndCondiiton from "../Pages/TermsAndCondiiton";

const Layout = lazy(() => import("../Layout/Layout"));
const Home = lazy(() => import("../Pages/Home"));
const AboutUs = lazy(() => import("../Pages/AboutUs"));
const ContactUs = lazy(() => import("../Pages/ContactUs"));
const OurPolicies = lazy(() => import("../Pages/OurPolicies"));

const Router = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/"
          element={
            <Layout>
              <Suspense>
                <Home />
              </Suspense>
            </Layout>
          }
        />


        <Route
          path="/about-us"
          element={
            <Layout>
              <Suspense>
                <AboutUs />
              </Suspense>
            </Layout>
          }
        />


        <Route
          path="/contact-us"
          element={
            <Layout>
              <Suspense>
                <ContactUs />
              </Suspense>
            </Layout>
          }
        />


        <Route
          path="/our-policies"
          element={
            <Layout>
              <Suspense>
                <OurPolicies />
              </Suspense>
            </Layout>
          }
        />


        <Route
          path="/terms-and-conditions"
          element={
            <Layout>
              <Suspense>
                <TermsAndCondiiton/>
              </Suspense>
            </Layout>
          }
        />

      </Routes>
    </BrowserRouter>
  );
};

export default Router;
